public boolean equals(Object o) {
  if (o == null || !(o instanceof AssignedDevice)) {
    return false;
  }
  AssignedDevice other = (AssignedDevice) o;
  return getDevice().equals(other.getDevice())
      && getContainerId().equals(other.getContainerId());
}
